import Header from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '2px solid #000000',
  backgroundColor: '#000000',
}

// imports Header pages in the layoutStyle above, index will import this
export default function Layout(props) {
  return (
    <div style={layoutStyle}>
      <Header />
      {props.children}
    </div>
  )
}
